import * as React from 'react';
import Link from 'next/link';
import * as S from './styled';
import Icon from '../../atoms/Icon';
import Logo from '../../atoms/Logo';

type Props = {
  left: string;
  main: string;
  right: Array<string>;
};

export const Header = ({ left, main, right }: Props) => (
  <S.Header>
    <div className="left-wrap">
      <Link href="/users">
        <a>
          <Icon icon={left} size={1.1} />
        </a>
      </Link>
    </div>
    <div className="main-wrap">
      <Link href="/about">
        <a>
          <Logo alt="logo" src="logo" size={4} />
        </a>
      </Link>
    </div>
    {right && (
      <div className="right-wrap">
        {right.map((iconType, i) => (
          <Icon key={i} icon={iconType} size={1.1} />
        ))}
      </div>
    )}
  </S.Header>
);
